import { Component, OnInit } from '@angular/core';
import { GlobalSignatureKey } from '../../../organizer-settings-core/models/enum';
import { AuthInfoStateService, User } from '../../../auth';
import { MatDialog } from '@angular/material';
import { OrganizerSignatureLayoutComponent } from '../organizer-signature-layout/organizer-signature-layout.component';

@Component({
  selector: 'dps-global-signature-creator-layout',
  templateUrl: './global-signature-creator-layout.component.html',
  styleUrls: ['./global-signature-creator-layout.component.scss']
})
export class GlobalSignatureCreatorLayoutComponent implements OnInit {

  constructor(private auth: AuthInfoStateService, public dialog: MatDialog) { }

  signatureTemplete: string;
  signatureHtml$: any;
  public signkey = GlobalSignatureKey;
  showHelp = false;
  helpImage = '';
  userInfo: User;

  ngOnInit() {
    this.setHelpImage();
    setTimeout(() => {
      this.showHelp = true;
      setTimeout(() => {
        this.showHelp = false;
      }, 1500);
    }, 500);

  }



  onSignatureChange() {
    if (this.signatureTemplete) {
      this.signatureTemplete = this.signatureTemplete.toString().replace(/[^\x20-\x7E]/g, '');
    }
    this.updateSignaturePreview();
  }

  updateSignaturePreview() {
    this.signatureHtml$ = this.auth.getGlobalSignatureForTemplete(this.signatureTemplete);
  }

  onSignatureCreatorBtnClicked() {
    const dialogRef = this.dialog.open(OrganizerSignatureLayoutComponent, {
      width: '700px',
      height: '700px',
      data: { userInfo: this.userInfo, globalSig: true },
      panelClass: 'dps-signature-creator',
      disableClose: true,
    });

    dialogRef.afterClosed().subscribe((result: string) => {
      if (result) {
        this.signatureTemplete = result;
        this.updateSignaturePreview();
      }
    });
  }

  setHelpImage() {
    this.helpImage = 'data:image/png;base64,'
  }



}
